import React from "react";
import '../style/header.css'
import home from '../icon/home.svg';
import {Router, Link } from "react-router-dom";

export class Header extends React.Component {
    constructor (props) {
        super(props)
        this.state = {
            list: [
                ['文章', '/lonelyhouse/page'],
                ['自省', '/lonelyhouse/alone'],
                ['散心', '/lonelyhouse/relax']
            ]
        }
    }

    render() {
        return (
            <Router>
                <header className="headerLine">
                    <div className="header-home">
                        <a href='/lonelyhouse'><img alt="Home" src={home} ></img></a>
                    </div>
                    <ul className="header-page">
                        {this.state.list.map((item, index) => <li className="header-page-item" key={index} ><Link to={item[1]}>{item[0]}</Link></li>)}
                    </ul>
                    <img alt="myGithub" src={home} className="header-github"></img>
                </header>
            </Router>
        )
    }
}
